INSERT INTO `products` (`id`, `url_id`, `page_id`, `brand_id`, `model_id`, `supplier_id`, `image`, `description`, `price`) VALUES
	(1, 1, 1, 1, 1, 1, 'https://www.buymobiles.net/files/images/handsets/apple/ipxr-grey-front.png', 'iPhone XR features a 6.1-inch Liquid Retina display. Six stunning colors. Advanced Face ID lets you securely unlock your iPhone and log in to apps with just a glance. The A12 Bionic chip uses real-time machine learning to transform the way you experience photos, gaming, augmented reality (AR), and more. A 12MP camera system with Portrait mode, Portrait Lighting, enhanced bokeh, and Depth Control for studio-quality portraits. And a water-resistant design.', 629),
	(2, 2, 2, 1, 2, 1, 'https://www.buymobiles.net/files/images/handsets/apple/ip8-grey-front.png', 'iPhone 8 features a stylish all-glass design. The 12MP camera is even better than previous generation. And wireless charging1 makes it effortless to power up. • Strong and stylish glass design • Fast and easy wireless charging1 • Amazing photos on a 12MP camera', 479),
	(3, 3, 3, 2, 3, 2, 'https://brain-images-ssl.cdn.dixons.com/8/6/10196668/u_10196668.jpg', 'Android 9 (Pie), 5.9" HD touchscreen, Dual 13 MP / 5 MP main cameras, 8 MP front camera, Battery capacity: 3500 mAh', 149.99),
	(4, 4, 3, 2, 4, 2, 'https://brain-images-ssl.cdn.dixons.com/8/8/10196788/u_10196788.jpg', 'Android 9 (Pie), 5.9" HD touchscreen, Dual 13 MP / 5 MP main cameras, 8 MP front camera, Battery capacity: 3500 mAh', 129.99),
	(5, 5, 4, 1, 5, 1, 'https://www.buymobiles.net/files/images/handsets/apple/iphone-11-black-front.png', 'All-new dual-camera system with Ultra Wide. Night mode and stunning video quality. Water and dust resistance.1 All-day battery life.2 In six stunning colors. Experience iPhone at 11. • 6.1-inch Liquid Retina HD LCD display3 • Water and dust resistant (2 meters for up to 30 minutes, IP68)1 • Dual-camera system with 12MP Ultra Wide and Wide cameras; Night mode, Portrait mode, and 4K video up to 60fps', 729),
	(6, 6, 1, 1, 6, 2, 'https://brain-images-ssl.cdn.dixons.com/1/6/10186161/u_10186161.jpg', 'iOS 12, 6.1" HD Liquid Retina touchscreen, 12 MP main camera, 7 MP front camera, Apple A12 Bionic processor', 679),
	(7, 7, 1, 1, 7, 2, 'https://brain-images-ssl.cdn.dixons.com/2/6/10186162/u_10186162.jpg', 'iOS 12, 6.1" HD Liquid Retina touchscreen, 12 MP main camera, 7 MP front camera, Apple A12 Bionic processor', 679),
	(8, 8, 1, 1, 8, 2, 'https://brain-images-ssl.cdn.dixons.com/7/3/10186037/u_10186037.jpg', 'iOS 12, 6.1" HD Liquid Retina touchscreen, 12 MP main camera, 7 MP front camera, Apple A12 Bionic processor', 679),
	(9, 9, 5, 1, 9, 1, 'https://www.buymobiles.net/files/images/handsets/apple/iphone-11-pro-grey-front.png', 'All new triple-camera system. All-day battery life.1 The fastest chip in a smartphone. And the brightest iPhone display yet. iPhone just went pro. • 5.8-inch Super Retina XDR OLED display3 • Water and dust resistant (4 meters for up to 30 minutes, IP68)2 • Triple-camera system with 12MP Ultra Wide, Wide, and Telephoto cameras; Night mode, Portrait mode, and 4K video up to 60fps', 1049),
	(10, 10, 1, 1, 10, 2, 'https://brain-images-ssl.cdn.dixons.com/0/7/10186070/u_10186070.jpg', 'iOS 12, 6.1" HD Liquid Retina touchscreen, 12 MP main camera, 7 MP front camera, Apple A12 Bionic processor', 679),
	(11, 11, 4, 1, 11, 2, 'https://brain-images-ssl.cdn.dixons.com/9/6/10197969/u_10197969.jpg', 'iOS 13, 6.1" HD Liquid Retina touchscreen, Dual 12 MP main cameras, 12 MP front camera, Apple A13 Bionic processor', 729),
	(12, 12, 4, 1, 12, 2, 'https://brain-images-ssl.cdn.dixons.com/0/7/10197970/u_10197970.jpg', 'iOS 13, 6.1" HD Liquid Retina touchscreen, Dual 12 MP main cameras, 12 MP front camera, Apple A13 Bionic processor', 729),
	(13, 13, 4, 1, 13, 2, 'https://brain-images-ssl.cdn.dixons.com/1/7/10197971/u_10197971.jpg', 'iOS 13, 6.1" HD Liquid Retina touchscreen, Dual 12 MP main cameras, 12 MP front camera, Apple A13 Bionic processor', 729),
	(14, 14, 4, 1, 14, 2, 'https://brain-images-ssl.cdn.dixons.com/2/7/10197972/u_10197972.jpg', 'iOS 13, 6.1" HD Liquid Retina touchscreen, Dual 12 MP main cameras, 12 MP front camera, Apple A13 Bionic processor', 729),
	(15, 15, 6, 1, 15, 1, 'https://www.buymobiles.net/files/images/handsets/apple/iphone-11-pro-grey-front.png', 'All new triple-camera system. All-day battery life.1 The fastest chip in a smartphone. And a 6.5-inch Super Retina XDR display-the biggest and brightest display in an iPhone.2 • 6.5-inch Super Retina XDR OLED display2 • Water and dust resistant (4 meters for up to 30 minutes, IP68)3 • Triple-camera system with 12MP Ultra Wide, Wide, and Telephoto cameras; Night mode, Portrait mode, and 4K video up to 60fps', 1149),
	(16, 16, 4, 1, 16, 2, 'https://brain-images-ssl.cdn.dixons.com/3/7/10197973/u_10197973.jpg', 'iOS 13, 6.1" HD Liquid Retina touchscreen, Dual 12 MP main cameras, 12 MP front camera, Apple A13 Bionic processor', 729),
	(17, 17, 4, 1, 5, 2, 'https://brain-images-ssl.cdn.dixons.com/4/7/10197974/u_10197974.jpg', 'iOS 13, 6.1" HD Liquid Retina touchscreen, Dual 12 MP main cameras, 12 MP front camera, Apple A13 Bionic processor', 729),
